import {AuthenticationError} from 'apollo-server-express';
import jwt from 'jsonwebtoken';
import crypto from 'crypto';

export function checkToken(token) {
  try {
    // IMPORTANT: Would usually store this key in some secrets repository (but in the interest of time, taking this terrible shortcut!)
    // eg. AWS Secrets Manager or GCP Secrets Management
    return jwt.verify(token, process.env.JWT_PUBLIC_KEY);
  } catch(err) {
    console.error('Invalid token');
    return null;
  }
}

export async function login({username, password}, {mysql}) {
  // IMPORTANT: Would usually store this key in some secrets repository (but in the interest of time, taking this terrible shortcut!)
  // eg. AWS Secrets Manager or GCP Secrets Management
  const passwordHash = crypto.createHmac("sha256", "some-super-secret-key")
    .update(password)
    .digest("hex");

  const [[row]] = await mysql.execute('SELECT user, password FROM users WHERE user = ?', [username]);

  if (row && row.password === passwordHash) {
    // We set expiration to something massive for the convenience of being able to test this API
    // without having to re-log in later.
    const token = jwt.sign({username}, process.env.JWT_PRIVATE_KEY, { expiresIn: '365d' });
    return {token};
  }

  throw new AuthenticationError('Invalid credentials');
}

export function logout(context) {
  context.user = undefined;
  return true;
}

